document.logs = {
    debug: function(msg) {
        console.debug(msg);
    },
    info: function(msg) {
        console.info(msg);
    },
    error: function(msg) {
        console.error(msg);
    },
    log: function(msg) {
        console.log(msg);
    },
    warn: function(msg) {
        console.warn(msg);
    }
};